import React, { useState, useContext } from "react";
import { useNavigate } from "react-router-dom";
import AuthContext from "store";
import * as style from "./styles";

function Login() {
  const navigator = useNavigate();
  const [values, setValues] = useState({ email: "", password: "" });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setValues({ ...values, [name]: value });
    console.log(event.target);
  };

  return (
    <>
      <style.Container>
        <style.Title>Login</style.Title>
        <style.LoginForm>
          <style.Span>Email address</style.Span>
          <style.textInput
            InputProps={{ disableUnderline: true }}
            placeholder="Email"
            name="email"
            required
            value={values.email}
            onChange={handleChange}
          ></style.textInput>
          <style.Span>Password</style.Span>
          <style.textInput
            InputProps={{ disableUnderline: true }}
            placeholder="Password"
            name="password"
            type="password"
            required
            value={values.password}
            onChange={handleChange}
          ></style.textInput>
          <style.LoginUtil>
            <style.CheckForm>
              <style.IdCheckBox type="checkbox" />
              <style.Span>Remember me</style.Span>
            </style.CheckForm>
            <style.Span>Reset Password?</style.Span>
          </style.LoginUtil>
          <style.ButtonContainer>
            <style.Button onClick={() => navigator("/sign_up")} type="submit">
              Create an account
            </style.Button>
            <style.Button>Login</style.Button>
          </style.ButtonContainer>
        </style.LoginForm>
      </style.Container>
    </>
  );
}

export default Login;
